import Post from "./Post";
import PostCreate from "./PostCreate";
import Stack from '@mui/material/Stack';


const Feed = () => {
    return (
        <Stack className="center" spacing={2} direction="column">
            <PostCreate />
            <Post />
    </Stack>
    );
};

export default Feed;
